// App.js
import React, { useState, useEffect } from "react";
import "./App.css";
import SearchBar from './SearchBar';
import NewsSection from './NewsSection';
import RecentContent from './RecentContent';
import VoteSection from './VoteSection';
import Toggle from "./Toggle";
import axios from "axios"; // Assuming you're using axios for API requests

// Dummy data for easy editing
const dummyInfluencerData = {
  name: "Taylor Swift",
  profession: "Pop Singer",
  nationality: "American",
  age: 34,
  vibeScore: 83,
};

const recentContentDummy = [
  { id: 1, title: "Post 1 - 56% Vibes", content: "Celebrity gains support with latest post." },
  { id: 2, title: "Post 2 - 44% Vibes", content: "Recent news affecting vibes significantly." },
  { id: 3, title: "Post 3 - 95% Vibes", content: "Celebrity's latest appearance is a major hit." }
];

const newsItemsDummy = [
  { id: 1, title: "Headline 1", content: "Celebrity gains support with latest post." },
  { id: 2, title: "Headline 2", content: "More news and updates on recent activities." },
  { id: 3, title: "Headline 3", content: "Celebrity facing challenges in recent news." }
];

function App() {
  const [useDummyData, setUseDummyData] = useState(true); // Track data mode
  const [influencerData, setInfluencerData] = useState(dummyInfluencerData);
  const [filteredNews, setFilteredNews] = useState(newsItemsDummy);
  const [filteredContent, setFilteredContent] = useState(recentContentDummy);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Toggle between dummy data and live data
  const toggleLiveData = () => {
    setUseDummyData(!useDummyData);
  };

  // Fetch real influencer data from the API when not using dummy data
  const fetchRealInfluencerData = async () => {
    setLoading(true);
    setError(null);

    try {
      // Replace with your actual API URL
      const influencerResponse = await axios.get("https://api.example.com/influencer");
      const newsResponse = await axios.get("https://api.example.com/news");
      const contentResponse = await axios.get("https://api.example.com/content");

      setInfluencerData(influencerResponse.data);
      setFilteredNews(newsResponse.data);
      setFilteredContent(contentResponse.data);
    } catch (err) {
      setError("Failed to fetch live data");
      setUseDummyData(true); // Revert to dummy data on error
    } finally {
      setLoading(false);
    }
  };

  // Trigger fetch when switching to real data
  useEffect(() => {
    if (!useDummyData) {
      fetchRealInfluencerData();
    } else {
      // Reset to dummy data
      setInfluencerData(dummyInfluencerData);
      setFilteredNews(newsItemsDummy);
      setFilteredContent(recentContentDummy);
    }
  }, [useDummyData]);

  return (
    <div className="container">
      <header className="header">
        <h1>vibeCHECK</h1>
        <SearchBar onSearchResult={(influencer) => setInfluencerData(influencer || dummyInfluencerData)} />
      </header>

      {loading && <div className="loading">Loading...</div>}
      {error && <div className="error">{error}</div>}

      <div className="profile">
        <img src="https://via.placeholder.com/80" alt="Celebrity" />
        <h2>{influencerData.name}</h2>
        <p>{influencerData.profession}, {influencerData.nationality}, Age {influencerData.age}</p>
        <div className="vibe-score">
          Vibe Score: {influencerData.vibeScore}%
        </div>
      </div>

      <div className="vibe-stats">
        <div>{influencerData.vibeScore}% Good Vibes</div>
        <div>{100 - influencerData.vibeScore}% Bad Vibes</div>
      </div>

      <VoteSection influencerId={influencerData.id} />

      <div className="vibe-details">
        <div>
          22% <br /> Media Sentiment
        </div>
        <div>
          76% <br /> Viewer Reactions
        </div>
      </div>

      <NewsSection items={filteredNews} />
      <RecentContent items={filteredContent} />

      {/* Toggle button at the bottom */}
      <Toggle useDummyData={useDummyData} toggleLiveData={toggleLiveData} />
    </div>
  );
}

export default App;
